import numpy as np

class HarmonySearch:
    def __init__(self, budget, dim):
        self.budget = budget
        self.dim = dim
        self.harmony_memory_size = 10
        self.bandwidth = 0.01
        self.harmony_memory = np.random.uniform(-5.0, 5.0, (self.harmony_memory_size, dim))

    def __call__(self, func):
        for _ in range(self.budget):
            new_solution = self.harmony_memory[np.random.randint(self.harmony_memory_size)]
            for i in range(self.dim):
                if np.random.rand() < 0.35:
                    new_solution[i] = np.clip(new_solution[i] + np.random.normal(0, self.bandwidth), -5.0, 5.0)
            if func(new_solution) < func(self.harmony_memory[-1]):
                self.harmony_memory[-1] = new_solution
            self.harmony_memory = self.harmony_memory[np.argsort([func(x) for x in self.harmony_memory])]
        return self.harmony_memory[0]

import numpy as np

class FireflyAlgorithm:
    def __init__(self, budget, dim):
        self.budget = budget
        self.dim = dim
        self.population = np.random.uniform(-5.0, 5.0, (budget, dim))
        self.alpha = 0.2  # alpha parameter for light absorption coefficient
        self.beta0 = 1.0  # initial attractiveness base value
        self.gamma = 1.0  # gamma parameter for attraction coefficient
        self.scale_factor = 0.5  # scaling factor for Lvy Flight step size

    def __call__(self, func):
        for _ in range(self.budget):
            for i in range(self.budget):
                for j in range(self.budget):
                    if func(self.population[j]) < func(self.population[i]):
                        attractiveness = self.beta0 * np.exp(-self.gamma * np.linalg.norm(self.population[j] - self.population[i])**2)
                        step = self.scale_factor * np.random.standard_cauchy(self.dim)
                        self.population[i] += attractiveness * (self.population[j] - self.population[i]) + self.alpha * step
        final_fitness = [func(x) for x in self.population]
        best_idx = np.argmin(final_fitness)
        best_solution = self.population[best_idx]

        return best_solution
